import React from 'react'
import Sidebuttons from './SideButtons'
import NavRoutes from './NavRoutes'

class Main extends React.Component{
    render(){
        return (
            <div name="main">
                <h1>Ben Lottes</h1>
                <Sidebuttons/>
                <NavRoutes/>
                {this.props.children}
            </div>
        )
    }
}

export default Main
